	/**
	 * 取送检申请资料
	 */
	private static void RLASample() {
		try {
			for (int i = 0; i < 3; i++) {
				String strTmh = ARRAY_STR_TMH[i];
				System.out.println("--------------------RLA读取条码[" + strTmh + "]数据测试开始：---------------------");
				//业务参数
				JSONObject joParamData = new JSONObject();
				joParamData.put("tmh", strTmh);
				// 传入参数
				StringBuilder sbParam = new StringBuilder();
				//				sbParam.append("choscode_apply=").append(STR_CHOSCODE_APPLY).append("&");// 申请检验的医疗机构代号
				sbParam.append("choscode_acpt=").append(STR_CHOSCODE_ACPT).append("&");// 受理检验医疗机构代号
				sbParam.append("check_code=").append(STR_CHECKCODE).append("&");// 医疗机构校验码
				sbParam.append("param=").append(new JSONObject().put("opt_type", "RLA").put("param_data", joParamData));//RLA读取条码 及 条码信息
				//调用接口
				String strRtn = HttpRequest.SendPost(STR_URL, sbParam.toString());
				//解析返回值
				String strRtnConvert = strRtn;
				Pattern pattern = Pattern.compile("(\\\\u(\\p{XDigit}{4}))");
				Matcher matcher = pattern.matcher(strRtnConvert);
				char ch;
				while (matcher.find()) {
					ch = (char) Integer.parseInt(matcher.group(2), 16);
					strRtnConvert = strRtnConvert.replace(matcher.group(1), ch + "");
				}
				JSONObject joRtn = new JSONObject(strRtnConvert);
				System.out.println(joRtn.getString("rtn_code"));
				System.out.println(joRtn.getString("rtn_msg"));
				JSONObject joRtnData = joRtn.getJSONObject("rtn_data");
				if (joRtnData.has("dxmmc")) {
					System.out.println("条码号:" + strTmh + " { 大项目名称：" + joRtnData.getString("dxmmc") + " }");//大项目名称
				}
				System.out.println(strRtnConvert);
				System.out.println();
			}
		} catch (Exception e) {
			System.out.println(e.getMessage());
		}
	}

